// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.0 <=0.8.19;

import "./Interfaces/ISupplierManufacturer.sol";
import "./userDetails.sol";
import "./supplierProduct.sol";

/// @title The contract for handling transfer between supplier and manufacturer product
/// @notice Uses ISupplierManufacturer interface
contract supplierManufacturer is ISupplierManufacturer{

    uint public smId = 1; // counter for tracking the number of supplierManufacturer instances
    uint public reqId = 1; // counter for tracking the number of requests made by the manufacturer

    userDetails udInstance; // instance of userDetails contract
    supplierProduct spInstance; // instance of supplierProduct contract
    address owner; // address of the contract owner

    struct supplierManufacturerWithProduct {
    supplierManufacturer smDetails;
    supplierProduct.supplierProduct spDetails;
    userDetails.userDetails uDetails;
    }

    constructor(address _udAddress, address _spAddress) {
        owner = msg.sender;
        udInstance = userDetails(_udAddress);
        spInstance = supplierProduct(_spAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    /// @notice Changes the contract owner
    /// @param _ownerAddress The new owner's address
    function changeOwner(address _ownerAddress) public onlyOwner{
        owner = _ownerAddress;
    }

    /// @notice Changes the address of the userDetails contract
    /// @param _udAddress The new userDetails contract address
    function changeUdAddress(address _udAddress) public onlyOwner{
        udInstance = userDetails(_udAddress);
    }

    /// @notice Changes the address of the supplierProduct contract
    /// @param _spAddress The new supplierProduct contract address
    function changeSpAddress(address _spAddress) public onlyOwner{
        spInstance = supplierProduct(_spAddress);
    }

    /// @notice Returns an array of all supplier addresses
    /// @return An array of all supplier addresses
    function getAllSupplierAddresses() public view returns(address[] memory){
        return udInstance.getAllSupplierAddresses();
    }

    // struct
       /*    uint sp_id;
          address supplierAddress;
          address manufacturerAddress;
          uint32 dispatchTime;
          uint32 arrivalTime;
          uint32 quantity;
          uint32 currentQuantity;
          transferStatus _status; */

    // events
        /* eventSupplierManufacturerTransfer
        eventArrivalTime */

    // enum transferStatus
       /*  none,
        Requested,  //1
        Approved,   //2
        Received    //3 */

    /// @dev A mapping to associate smId with supplierManufacturer
    mapping(uint => supplierManufacturer) public smIdToStructMapping;

    /// @dev A mapping to associate manufacturer's address with the smId
    mapping(address => uint[]) public manufacturerTosmIdMapping;

    /// @dev A mapping to associate supplier's address with the smId
    mapping(address => uint[]) public supplierTosmIdMapping;

    /// @notice function to transfer product from supplier to manufacturer
    function transferProduct(uint _smId,address _manufacturerAddress,uint32 _quantity,uint32 _currentQuantity)external override{
        userDetails.userDetails memory user = udInstance.getSingleUser(msg.sender);
        require(uint8(user.userType)== 0,"Only Supplier can Transfer product"); 
        address caller = msg.sender;
        uint256[] memory supplierAddresses = spInstance.getSpIdsByAddress(caller);
        bool found = false;
        for (uint i = 0; i < supplierAddresses.length; i++) {
            if (supplierAddresses[i] == smIdToStructMapping[_smId].spId) {
                found = true;
                break;
            }
        }
        require(found, "Product not owned by you");

        smIdToStructMapping[_smId].supplierAddress = msg.sender;
        smIdToStructMapping[_smId].dispatchTime = uint32(block.timestamp);
        smIdToStructMapping[_smId].currentQuantity = _currentQuantity;
        smIdToStructMapping[_smId].status = transferStatus.Approved;
        emit eventSupplierManufacturerTransfer(smId,smIdToStructMapping[_smId].spId,msg.sender,_manufacturerAddress,uint32(block.timestamp));
        spInstance.updateSupplierProductUints(smIdToStructMapping[_smId].spId,_quantity,caller);
    }

    // function testGet()public view returns(uint[] memory){
    //     address caller = msg.sender;
    //     return spInstance.getSpIdsByAddress(caller);
    // }

    function requestProduct(uint _spId,uint32 _quantity, address _supplierAddress)external override {
        userDetails.userDetails memory user = udInstance.getSingleUser(msg.sender);
        require(uint8(user.userType)== 1,"Only Manufacturer can Request product"); 

        smIdToStructMapping[smId] = supplierManufacturer(smId,_spId,_supplierAddress,msg.sender,0,0,_quantity,0,transferStatus.Requested);
        manufacturerTosmIdMapping[msg.sender].push(smId);
        // supplierTosmIdMapping[msg.sender].push(smId);
        supplierTosmIdMapping[_supplierAddress].push(smId);
        smId++;
    }
    
    /// @notice function to update that the product has been received
    function receiveProduct(uint _smId)external override{
        userDetails.userDetails memory user = udInstance.getSingleUser(msg.sender);
        require(uint8(user.userType) == 1,"Only Manufacturer can acknowledge receive product"); 

        smIdToStructMapping[_smId].arrivalTime = uint32(block.timestamp);
        smIdToStructMapping[_smId].status = transferStatus.Received;
        emit eventArrivalTime(uint32(block.timestamp));
    } 

    /// @notice function to get single product transfer information
    function getSmDetails(uint _smId) public view returns(supplierManufacturer memory){
        return smIdToStructMapping[_smId];
    }

    /// @notice function to get all trasnfers manufacturer has received
    function getAllSmIdForManufacturer(address _manufacturerAddress) public view returns(supplierManufacturer[] memory){
        uint[] memory smIdData = manufacturerTosmIdMapping[_manufacturerAddress];
        supplierManufacturer[] memory smIdDetails = new supplierManufacturer[](smIdData.length);
        for(uint i=0;i<smIdData.length;i++)
        {
            smIdDetails[i] = smIdToStructMapping[smIdData[i]];
        }
        return smIdDetails;
    }

    function getAllSmIdForSupplier(address _supplierAddress) public view returns(supplierManufacturer[] memory){
        uint[] memory smIdData = supplierTosmIdMapping[_supplierAddress];
        supplierManufacturer[] memory smIdDetails = new supplierManufacturer[](smIdData.length);
        for(uint i=0;i<smIdData.length;i++)
        {
            smIdDetails[i] = smIdToStructMapping[smIdData[i]];
        }
        return smIdDetails;
    }

    function getAllSmIdForSupplierWithproductDetails(address _supplierAddress) public view returns(supplierManufacturerWithProduct[] memory){
    uint[] memory smIdData = supplierTosmIdMapping[_supplierAddress];
    supplierManufacturerWithProduct[] memory smIdDetails = new supplierManufacturerWithProduct[](smIdData.length);
    for(uint i=0;i<smIdData.length;i++)
    {
        smIdDetails[i].smDetails = smIdToStructMapping[smIdData[i]];
        smIdDetails[i].spDetails = spInstance.getSingleSupplierProduct(smIdDetails[i].smDetails.spId);
        smIdDetails[i].uDetails = udInstance.getSingleUser(smIdDetails[i].smDetails.manufacturerAddress);

    }
    return smIdDetails;
}

 function getAllSmIdForManufacturerWithproductDetails(address _manufacturerAddress) public view returns(supplierManufacturerWithProduct[] memory){
    uint[] memory smIdData = manufacturerTosmIdMapping[_manufacturerAddress];
    supplierManufacturerWithProduct[] memory smIdDetails = new supplierManufacturerWithProduct[](smIdData.length);
    for(uint i=0;i<smIdData.length;i++)
    {
        smIdDetails[i].smDetails = smIdToStructMapping[smIdData[i]];
        smIdDetails[i].spDetails = spInstance.getSingleSupplierProduct(smIdDetails[i].smDetails.spId);
        smIdDetails[i].uDetails = udInstance.getSingleUser(smIdDetails[i].smDetails.supplierAddress);

    }
    return smIdDetails;
}


}

contracts/supplierProduct.sol.content:
// SPDX-License-Identifier: GPL-3.0
import "./Interfaces/ISupplierProduct.sol";
import "./userDetails.sol";

pragma solidity >=0.8.0 <=0.8.19;

/// @author ProvyLens team
/// @title The contract for handling supplier' product
/// @notice Uses ISupplierProduct interface

contract supplierProduct is ISupplierProduct{

    userDetails udInstance; // instance of userDetails contract
    address owner; // address of the contract owner

    constructor(address _udAddress) {
        owner = msg.sender;
        udInstance = userDetails(_udAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    /// @notice Changes the contract owner
    /// @param _ownerAddress The new owner's address
    function changeOwner(address _ownerAddress) public onlyOwner{
        owner = _ownerAddress;
    }

    /// @notice Changes the address of the userDetails contract
    /// @param _udAddress The new userDetails contract address
    function changeUdAddress(address _udAddress) public onlyOwner{
        udInstance = userDetails(_udAddress);
    }

    /// @notice variable to keep track of product index
    uint spId = 1;

    /// @notice mapping product index with supplierProduct struct
    mapping(uint => supplierProduct) public supplierProductsIdToStructMapping;

    /// @notice mapping user' address with all the created products
    mapping(address => uint[]) public supplierAddressToproductsIdMapping;

    // struct
        //  address supplierAddress;
        //   bytes sp_name;
        //   bytes sp_description;
        //   uint128 sp_unit;
        //   uint128 sp_price;
        //   uint32 sp_date;
        //   uint32 sp_expiryDate;
        //   bool sp_status;

    //events
        // eventAddSupplierProduct
        // eventDeleteSupplierProduct
        // eventUpdateSupplierProductUints
    
    /// @notice function to add supplier product
    function addSupplierProduct(bytes calldata _name,bytes calldata _description,uint128 _unit,uint128 _price,uint32 _date,uint32 _expiryDate)public override  {
        userDetails.userDetails memory user = udInstance.getSingleUser(msg.sender);
        require(uint8(user.userType)== 0,"Only Supplier can add products"); 

        supplierProductsIdToStructMapping[spId] = supplierProduct(msg.sender,_name,_description,_unit,_price,_date,_expiryDate,true);
        supplierAddressToproductsIdMapping[msg.sender].push(spId);
        emit eventAddSupplierProduct(spId,msg.sender,_name,_description,_unit,_price,_date,_expiryDate,block.timestamp);
        spId++;
    }

    /// @notice function to update supplier product units
    function updateSupplierProductUints(uint _spId, uint128 _quantity,address _supplierAddress) external override {
        
        uint256[] memory supplierAddresses = getSpIdsByAddress(_supplierAddress);
        bool found = false;
        for (uint i = 0; i < supplierAddresses.length; i++) {
            if (supplierAddresses[i] == _spId) {
                found = true;
                break;
            }
        }
        require(found, "Product not owned by you");

        supplierProductsIdToStructMapping[_spId].sp_unit -= _quantity;  
        emit eventUpdateSupplierProductUints(_spId, supplierProductsIdToStructMapping[_spId].sp_unit);
    }

    /// @notice function to return supplier product IDs
    function getSupplierProductIds() public view returns(uint[] memory){
        return supplierAddressToproductsIdMapping[msg.sender];
    }

    ///
    function getSpIdsByAddress(address _address) public view returns(uint[] memory){
        return supplierAddressToproductsIdMapping[_address];
    }

    /// @notice function to return supplier' single product
    function getSingleSupplierProduct(uint _spId) public view returns(supplierProduct memory){
        return supplierProductsIdToStructMapping[_spId];
    }

    /// @notice function to get all supplier products that it created on the platform
    function getAllProductsOfSupplier(address _supplierAddress) public view returns(supplierProduct[] memory, uint[] memory _productIds)
    {
        uint[] memory productIds= supplierAddressToproductsIdMapping[_supplierAddress];
        supplierProduct[] memory supplierP = new supplierProduct[](productIds.length);
        for(uint i=0;i<productIds.length;i++)
        {
            supplierP[i] =supplierProductsIdToStructMapping[productIds[i]];
        }
        return (supplierP,productIds);
    }

    /// @notice function to get all supplier products that it created on the platform(which are currently active)
    function getAllActiveProductsOfSupplier(address _supplierAddress) public view returns (supplierProduct[] memory, uint[] memory)
    {
        uint[] memory productIds = supplierAddressToproductsIdMapping[_supplierAddress];
        uint[] memory activeProductsIds = new uint[](productIds.length);
        supplierProduct[] memory supplierProducts = new supplierProduct[](productIds.length);
        uint activeCount = 0;
        for (uint i = 0; i < productIds.length; i++) {
            uint productId = productIds[i];
            if (supplierProductsIdToStructMapping[productId].sp_status) {
                supplierProducts[activeCount] = supplierProductsIdToStructMapping[productId];
                activeProductsIds[activeCount] = productId;
                activeCount++;
            }
        }
        uint[] memory activeIds = new uint[](activeCount);
        for (uint i = 0; i < activeCount; i++) {
            activeIds[i] = activeProductsIds[i];
        }
        return (supplierProducts, activeIds);
    }



    /// @notice function to delete supplier product (making the product Inactive)
    function deleteSupplierProduct(uint _spId)public override {

        uint256[] memory supplierAddresses = getSupplierProductIds();
        bool found = false;
        for (uint i = 0; i < supplierAddresses.length; i++) {
            if (supplierAddresses[i] == _spId) {
                found = true;
                break;
            }
        }
        require(found, "Product not owned by you");

        supplierProductsIdToStructMapping[_spId].sp_status=false;
        emit eventDeleteSupplierProduct(_spId);
    }
}

contracts/userDetails.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <=0.8.19;

/// @author ProvyLens team
/// @title The contract for handling userData
/// @notice Uses IUserDetails interface

import "./Interfaces/IUserDetails.sol" ;

contract userDetails is IUserDetails{
    /// @notice mapping address with userDetails struct
    mapping(address=>userDetails) public userDetailsMapping;

    /// @notice array to keep track of user' catogery
    address[] public users;
    address[] public suppliers;
    address[] public manufacturers;
    address[] public distributors;

    // struct
        // eventUserData
        // eventDeleteUser
        
    /// @notice function to add the user
    function addUser(userType _type, bytes calldata _name, bytes calldata _physicalAddress,bytes memory _image)public override {
        require((userDetailsMapping[msg.sender].userName).length == 0, "User already registered");
        userDetailsMapping[msg.sender] = userDetails(_type,_name,_physicalAddress,_image, true);
        users.push(msg.sender);
        if(_type == userType.Supplier) suppliers.push(msg.sender);
        if(_type == userType.Manufacturer) manufacturers.push(msg.sender);
        if(_type == userType.Distributor) distributors.push(msg.sender);
        emit eventUserData(msg.sender,_type,_name,_physicalAddress,_image,block.timestamp);
    }

    /// @notice Function to delete the user
    function deleteUser()public override {
        userDetailsMapping[msg.sender].userStatus = false;
        emit eventDeleteUser(msg.sender);
    }

    /// @notice function to edit the name of the user
    function editName(bytes memory _name)public override {
        userDetailsMapping[msg.sender].userName = _name;
        userDetails memory u = userDetailsMapping[msg.sender];
        emit eventUserData(msg.sender,u.userType,_name,u.userPhysicalAddress,u.userImage,block.timestamp);
    }

    /// @notice function to edit the physical address of the user
    function editPhysicalAddress(bytes memory _physicalAddress)public override{
        userDetailsMapping[msg.sender].userPhysicalAddress = _physicalAddress;
        userDetails memory u = userDetailsMapping[msg.sender];
        emit eventUserData(msg.sender,u.userType,u.userName,_physicalAddress,u.userImage,block.timestamp);

    }

    /// @notice function to edit the Image of the user
    function editImage(bytes memory _image)public override {
        userDetailsMapping[msg.sender].userImage = _image;
        userDetails memory u = userDetailsMapping[msg.sender];
        emit eventUserData(msg.sender,u.userType,u.userName,u.userImage,_image,block.timestamp);
    }

    /// @notice function to return user details of any perticular user
    function getSingleUser(address _address) public view returns(userDetails memory){
        return userDetailsMapping[_address];
    }

    /// @notice function to return all the users registered on provyLens
    function getAllUsers() public view returns(userDetails[] memory){
        userDetails[] memory userD = new userDetails[](users.length);
        for(uint i=0;i<users.length;i++)
        {
            userD[i] = userDetailsMapping[users[i]];
        }
        return userD;
    }

    /// @notice function to return all the users registered as suppliers
    function getAllSuppliers() public view returns(address[] memory, userDetails[] memory) {
        address[] memory suppAddresses = new address[](suppliers.length);
        userDetails[] memory suppDetails = new userDetails[](suppliers.length);

        for(uint i=0; i<suppliers.length; i++) {
            address suppAddress = suppliers[i];
            userDetails memory details = userDetailsMapping[suppAddress];
            suppAddresses[i] = suppAddress;
            suppDetails[i] = details;
        }

        return (suppAddresses, suppDetails);
    }

    
    function getAllSupplierAddresses() public view returns(address[] memory) {
        return suppliers;
    }

    /// @notice function to return all the users registered as manufacturers
    function getAllManufacturers() public view returns(userDetails[] memory){
        userDetails[] memory manuD = new userDetails[](manufacturers.length);
        for(uint i=0;i<manufacturers.length;i++)
        {
            manuD[i] = userDetailsMapping[manufacturers[i]];
        }
        return manuD;

    }

    /// @notice function to return all the users registered as distributors
    function getAllDistributors() public view returns(userDetails[] memory){
        userDetails[] memory distD = new userDetails[](distributors.length);
        for(uint i=0;i<distributors.length;i++)
        {
            distD[i] = userDetailsMapping[distributors[i]];
        }
        return distD;

    }

}

